import AppInstance from '../model/AppState';
class AppPresenter {
    getLoggedUser() {
        return AppInstance.getLoggedUser
    }

    setLoggedUserId(username) {
        return AppInstance.setLoggedUserId(username);
    }
}
const AppPresenterInstance = new AppPresenter();
export default AppPresenterInstance;
